import picture from '../../img/my-picture.webp';
import './home.scss';

const Home = () => (
  <section className="homepage">
    <img src={picture} alt="Nicolas Olaya" className="nicolas-picture" />
    <h2 className="title">Hi, I&apos;m Nicolas Olaya</h2>
    <p className="description">
      I&apos;m a software developer with a passion for web development.
      I&apos;m currently working at
      {' '}
      <a href="https://www.globant.com/" target="_blank" rel="noreferrer">Globant</a>
      {' '}
      as a Frontend Developer.
    </p>
  </section>
);

export default Home;
